import { MicNone } from "@material-ui/icons";
import React from "react";

const SearchResult = ({ data }) => {
   data.map((item) => (
    <div className="container ">
      <div className="row">
        <div className="col-3">
          <div
            className="card search-result-card"
            style={{
              display: "flex",
              flexDirection: "row",
              justifyContent: "space-between",
            }}
          >
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                justifyContent: "space-between",
              }}
            >
              <img
                className="profileImage rounded-circle"
                src="https://wallpaperaccess.com/full/2213424.jpg"
              ></img>
              <div style={{ marginLeft: "8px", marginTop: "8px" }}>
                <p style={{ textTransform: "capitalize" }}>{item.name}</p>
              </div>
            </div>
            <a
              href="#"
              style={{
                textDecoration: "none",
                color: "crimson",
                marginTop: "8px",
                marginRight: "10px",
              }}
            >
              Follow
            </a>
          </div>
        </div>
      </div>
    </div>
  ));
};

export default SearchResult;
